import './Projects.css'
import React, { Component } from 'react';
import Form from 'react-bootstrap/Form'
import Button from 'react-bootstrap/Button'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import { Link } from 'react-router-dom';
import { Nav } from 'react-bootstrap';
import { Navbar } from 'react-bootstrap';
import { NavDropdown } from 'react-bootstrap';
import { Container } from 'react-bootstrap';
import { Modal } from 'react-bootstrap';
import { useState } from 'react';
import {motion} from 'framer-motion'
import Carousel from 'react-bootstrap/Carousel'
import projectData from './ProjectData';






export const Projects = (props) => {




return (
<div className='page'>   




{/* ------------------------------------------------------ */}

<motion.div 
initial={{x:-1000}} animate={{x: 30 }} transition={{delay:0.4}}
className='skill-div'
>

<Row>

<h1 className='skill-head' > {props.title} </h1>   


<Col><p className='skills'> {props.description}</p>
<Row>
<motion.p animate={{x:35}} className='small-txt' > Links : <br></br><br></br><li ><a href='https://github.com/'><motion.img whileHover={{scale : 1.3}} className='Git' src='data:image/png;base64,' height={50} width={50} /></a></li>
</motion.p>
<motion.p className='small-txt' initial={{x:-1000}} animate={{x: 200, y:-45 }} transition={{delay:0.4}}> Github</motion.p>
</Row>
<Row>
<motion.p animate={{x:35}} className='small-txt' >  <li ><a href='https://github.com/'><motion.img whileHover={{scale : 1.3}} className='Git' src='https://upload.wikimedia.org/wikipedia/commons/0/09/YouTube_full-color_icon_%282017%29.svg' height={50} width={50} /></a></li>
</motion.p>
<motion.p className='small-txt' initial={{x:-1000}} animate={{x: 200, y:-45 }} transition={{delay:0.4}}> Comming soon</motion.p>
</Row>
</Col>


{ props.pictures.length == 0 ? <Col></Col> : 
<Col className='cor-img-div'>

    <Carousel>
      {
        (() => {
          const carouselItems = [];
          for (let index = 0; index < props.pictures.length; index++) {
            const picture = props.pictures[index];
            const caption = props.captions[index];

            carouselItems.push(
              <Carousel.Item key={index}>
                <motion.img
                  initial={{ opacity: 0 }}
                  animate={{ opacity: 1 }}
                  src={picture}
                  height={400}
                  width={700}
                />
                <Carousel.Caption className='caption'>
                  <div className='carousel-div'>
                    <p>{caption}</p>
                  </div>
                </Carousel.Caption>
              </Carousel.Item>
            );
          }
          return carouselItems;
        })()
      }
    </Carousel>

</Col>}



</Row>
</motion.div>

{/* ------------------------------------------------------ */}










</div>                  

);


}
